a:260:{i:0;a:1:{s:2:"id";s:19:"2390976524600161566";}i:1;a:1:{s:10:"short_code";s:11:"CEudHsvFzUe";}i:2;a:1:{s:12:"created_time";i:1599246647;}i:3;a:1:{s:7:"caption";s:1857:"𝗡𝘂𝗹𝗹𝗮 𝗺𝗮𝗶 𝗲̀ 𝗦𝗖𝗢𝗡𝗧𝗔𝗧𝗢 - parte 1

Non lasciare che la vita ti sfugga.  Apri gli occhi su ciò che ti circonda.  Sei qui, in questo momento, vivo.  Ma dai le cose per scontate?  Se è così , è tempo di cambiare tutto.
Hai tutto quello che ci vuole, adesso, dentro di te.  Il tuo viaggio ovunque inizia da dentro .  La gratitudine è il dono che continua a dare e con esso puoi trovare gioia.

 Tuttavia, dare le cose per scontate può togliere quella gioia.  Perdi il tuo potere e il tuo scopo.  Non ti fermi più ad annusare le rose.  Non le guardi nemmeno.  Lascia andare le piccole cose e il resto  è ne va di conseguenza.

 Ma quando provi gratitudine e gioia, fiorisci.  Ti ritrovi.  Tu sai chi sei.  Riesci a respirare anche quando ti senti addosso il peso del mondo.  Impari a lasciar andare e ad apprezzare il bene piuttosto che aggrapparti a cose che non ti servono più.  E tutto questo è alla tua portata, da subito.

 Ecco cinque motivi per cui dare le cose per scontate può toglierti la gioia.

 1. Egoismo

 Quando manca la gratitudine, potresti ritrovarti a pensare solo a te stesso.  Le tue azioni potrebbero essere più egoiste.  Puoi isolarti da coloro che ami e a cui tieni perché vedi solo i tuoi bisogni.  Questa azione ti rende più egoista e  vivrai per l’appagamento dell’ego piuttosto che per provare vero altruismo e gioia.

Il resto lo trovi gratuitamente su:
